export default class extends React.Component {
    render() {
        return (
            <header className='header'>
                <div className='logo'>
                    <div>
                        <img src='https://coreui.io/react/demo/static/media/logo.406a451a.svg'></img>
                    </div>
                    <div>
                        <button type='button'>
                            <i class="fa fa-bars"></i>
                        </button>
                    </div>
                </div>
                <div className='menu'>
                    <ul>
                        <li>Dashboard</li>
                        <li>Profesores</li>
                        <li>Estudiantes</li>
                        <li>Cursos</li>
                    </ul>
                </div>
                <style jsx>{`
            .header{
                background: white;
                display: flex;
                flex-direction: row;
                width: 100%;
                height: 6%;
                border: solid 1px gray;
            }

            .header .logo{
                width: 10%;
                display: flex;
                justify-content: center;
                align-items: center;
                text-align: right;
            }

            .header .logo img{
                width: 60%;
                height: 30%;
                margin-right: 20px;
            }

            .header .logo button{
                color: gray;
                font-size: 1.3rem;
                background: transparent;
                border: none;
            }

            .header .menu{
                width: 40%;
                display: flex;
                justify-content: center;
                align-items: center;
                border: 1px solid;
            }

            ul{
                width: 80%;
                margin: 0;
                padding: 0;
            }

            ul li{

                list-style: none;
                display: inline-block;
                padding: 20px;  
            }

        `}</style>
            </header>
        );
    }
}
